import styled from 'styled-components';

export const Container = styled.div`
  button {
    background-color: #001d50;
    height: 56px;
    border-radius: 100px;
    padding: 0 16px;
    font-weight: 500;
    margin-top: 18px;
    width: 100%;
    border: 0;
    color: #ffffff;
  }
`;
